import React from 'react'
import ReactDom from 'react-dom';



class App extends React.Component {
    constructor() {
        super();
        console.log('getDefaultProps');

    }


    render() {
        return (
            <div></div>
        )
    }

}



ReactDom.render(
    <App/>,
    document.querySelector("#root"),
    ()=>console.log('render is over')
)
